    through April of 1938. The report begins by summarizing the weather conditions and
    water conditions during this period. Wildlife- including migratory birds, upland
    game birds, predators, and raptors- is also covered. The Refuge development and
    maintenance section discusses physical developments and plantings. N-R forms and
